import React from 'react'
import {
    useParams,
    Route
} from 'react-router-dom';
import routes from './Content/SideBar/routes';
import Cart from './Content/Cart/Cart';
import Home from './Content/Home/Home';
import Menu from './Content/Menu/Menu';



function ContentRoutes() {
    let { page, content } = useParams();
    console.log(page);
    return (
        <>
            {routes[page].map((route, index) => {
                return <Route key={index} exact path={`${page}`} children={<route.content content={content} />} />
            })}
        </>
    )
}

export default ContentRoutes
